// SpSideNavbar.js
import React from 'react';
import { Link, Outlet } from 'react-router-dom';
import './SPSideNavbar.css';

const SpSideNavbar = () => {
  return (
    <div className="sidenav">
      <div className="sidenav-heading">
        <span className="sidenav-heading-span">Dashboard</span>
      </div>
      <div className="sidenav-ul">
        <ul style={{ listStyle: "none" }}>
          <span className='span-li'>
            <li>
              <Link className="nav-link" to='/upcoming-bookings'>Upcoming Bookings</Link>
            </li>
          </span>
        </ul>
      </div>
    </div>
  );
};

export default SpSideNavbar;
